import { Route, Routes } from "react-router-dom";
import Main from "./Main";
import React from "react";
import "./styels.css";
import DisplayButton from "./components/Task1/DisplayButton";
import ToDoList from "./components/Task2/ToDoList";
function App() {
  return (
    <div>
      <Routes>
        <Route element={<Main />} path="/">
          <Route
            Component={React.createElement(<DisplayButton />)}
            path="/display"
          ></Route>
          <Route
            Component={React.createElement(<ToDoList />)}
            path="/todolist"
          ></Route>
          <Route
            Component={React.createElement(<DisplayButton />)}
            path="/display"
          ></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
